  "BrowseProducts" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>BrowseProducts</b></td></tr></table>>, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
  "ViewProduct" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>ViewProduct</b></td></tr></table>>, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
  "AddItem" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>AddItem</b></td></tr></table>>, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
  "ViewCart" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>ViewCart</b></td></tr></table>>, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
  "CalculateTotal" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>CalculateTotal</b></td></tr></table>>, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
  "ShippingAddress" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>ShippingAddress</b></td></tr></table>>, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];
  "OrderConfirmation" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>OrderConfirmation</b></td></tr></table>>, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];

  // Edges
  "Home" -> "BrowseProducts" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
  "BrowseProducts" -> "ViewProduct" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
  "ViewProduct" -> "AddItem" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
  "AddItem" -> "ViewCart" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
  "ViewCart" -> "CalculateTotal" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
  "CalculateTotal" -> "ShippingAddress" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
