  "OrderConfirmation" -> "OrderHistory" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
  "Home" -> "UserProfile" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
  "UserProfile" -> "OrderHistory" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
  "Home" -> "CustomerSupport" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
